import React from 'react';
import './recommended.css';

function Recommended() {
  return (
    <div className="Recommended">
      <div>
        <img className="main"src="https://images-na.ssl-images-amazon.com/images/I/61ZR8vBARFL._AC_SL1000_.jpg"/>
      </div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
      <div>5</div>
    </div>
  );
}

export default Recommended;
